import React from 'react';
import moment from 'moment'
import Moment from 'react-moment';
import 'moment-timezone';
import clientList from '../data/clients';
import '../CSS/ClientHome.css';

function ClientHome(data) {
  const { match: { params: { clientId } } } = data
  const allClients = clientList.clients;
  console.log(allClients)
  const client = allClients.find((value) => value.clientId === Number(clientId));
  console.log(client)
  return(
    <div className="client-home-container">
      <header>
        <div>
          <h1>{ client.name }</h1>
          <p>Idade:
            { moment()
              .diff(`${client.birth_date}`, 'years') } anos
          </p>
        </div>
        <div>
          <p>CPF/CNPJ: { client.cpf_cnpj }</p>
          <p>Cadastrado em: <Moment format="DD/MM/YYYY">{ client.register }</Moment></p>
        </div>
      </header>
      <section>
        <h5>Endere√ßos cadastrados</h5>
      </section>
    </div>
  )
}

export default ClientHome;
